export default {
  __name: 'bigScreen',
  props: ['resInformation'],
  setup(__props, { expose }) {
  expose();

const resInformation = __props;



const __returned__ = { resInformation }
Object.defineProperty(__returned__, '__isScriptSetup', { enumerable: false, value: true })
return __returned__
}

}
